import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule } from '@angular/common/http'; // HttpClientModule ekleyin
import { ReactiveFormsModule } from '@angular/forms'; // ReactiveFormsModule ekleyin

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HomeComponent } from './components/home/home.component';
import { LoginComponent } from './components/login/login.component';
import { RegisterComponent } from './components/register/register.component';
import { Page1Component } from './components/components/page1/page1.component';
import { Page2Component } from './components/components/page2/page2.component';
import { Page3Component } from './components/components/page3/page3.component';
import { Page4Component } from './components/components/page4/page4.component';
import { Page5Component } from './components/components/page5/page5.component';

@NgModule({
  declarations: [
    AppComponent,
    HomeComponent,
    LoginComponent,
    RegisterComponent,
    Page1Component,
    Page2Component,
    Page3Component,
    Page4Component,
    Page5Component
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule, // HttpClientModule ekleyin
    ReactiveFormsModule // ReactiveFormsModule ekleyin
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
